import React from "react";
import Card from "./Card";
import Array from './Array'

function ncard(val) {
  return (
    <>
      <Card
        key={val.id}
        name={val.name}
        age={val.age}
        degree={val.degree}
      />
    </>
  );
}

function App() {
  return Array.map(ncard);
}

export default App;
